package main

import (
	"fmt"
	"strings"
)

func removeUnitType(s string, ch1 string, ch2 string) string {
	s = strings.Replace(s, ch1, "", -1)
	s = strings.Replace(s, ch2, "", -1)
	return s
}

func react(s string) string {
	old_str := s
	for {
		var new_str string
		skip_count := 0
		for i := 0 ; i < len(old_str) - 1 ; i++ {
			react := false
			ch1 := string(old_str[i])
			ch2 := string(old_str[i+1])
			if strings.ToLower(ch1) == strings.ToLower(ch2) && ch1 != ch2 {
				react = true
			}
			if !react {
				new_str += string(old_str[i])
			} else {
				skip_count++
				i++
			}
		}
		new_str += string(old_str[len(old_str)-1])
		old_str = new_str
		if skip_count == 0 {
			break
		}
	}
	return old_str
}

func main() {

	raw_str := ``

//	new_str := react(raw_str)

//	fmt.Println(len(new_str))

	a := "a"[0]
	A := "A"[0]

	for i := 0 ; i < 26; i++ {
		ch1 := string(int(a) + i)
		ch2 := string(int(A) + i)
		str_rem := removeUnitType(raw_str, ch1, ch2)
		fmt.Println("with no", string(ch1), ":", len(str_rem))
		rem_reacted := react(str_rem)
		fmt.Println("reacted:",len(rem_reacted))
	}
}
